<!DOCTYPE html>
<html>
    <head>
        <title>CMD Prompt</title>
        <link rel="icon" type="image/x-icon" href="favicon.png">
    </head>
    <body>
        <link rel="stylesheet" href="Fake-CMD.css"></style>
        <input class="input" onkeydown="
            if (event.key == 'Enter') {
                input();
            }
        ">
        <div class="give a1"></div>
        <div class="give a1a"></div>
        <div class="give a2"></div>
        <div class="give a2a"></div>
        <div class="give a3"></div>
        <div class="give a3a"></div>
        <div class="give a4"></div>
        <div class="give a4a"></div>
        <div class="give a5"></div>
        <div class="give a5a"></div>
        <div class="give a6"></div>
        <div class="give a6a"></div>
        <div class="give a7"></div>
        <div class="give a7a"></div>
        <div class="give a8"></div>
        <div class="give a8a"></div>
        <div class="give a9"></div>
        <div class="give a9a"></div>
        <div class="give a10"></div>
        <div class="give a10a"></div>
        <script src="Fake-CMD.js"></script>
    </body>
</html>
